import React from 'react';
import { Navbar, Container, Button, Dropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'video.js/dist/video-js.css';
import 'videojs-contrib-hls';
import './App.css';
import VideoPlayer from './video.js';

function App() {
  const videoJsOptions = {
    autoplay: true,
    controls: true,
    width: 960,
    height: 540,
    sources: [
      {
        src: 'http://localhost:8001/live/test/index.m3u8',
        type: 'application/x-mpegURL',
      },
    ],
  };

  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand>RTMP Player</Navbar.Brand>
          <Dropdown className="ml-auto">
            <Dropdown.Toggle variant="outline-primary" id="dropdown-menu">
              <span className="navbar-toggler-icon"></span>
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="/dashboard">Dashboard</Dropdown.Item>
              <Dropdown.Item href="/input">Input</Dropdown.Item>
              <Dropdown.Item href="/sources">Sources</Dropdown.Item>
              <Dropdown.Item href="/events">Events</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </Container>
      </Navbar>
      <div className="app-container">
        <div className="player-wrapper">
          <VideoPlayer {...videoJsOptions} />
        </div>
      </div>
    </div>
  );
}

export default App;
